    register,
    handleSubmit,
    watch,
    formState: { errors },
  } = useForm();
  const onSubmit = (dataObj) => {};
  return (
    <div>
      <form onSubmit={handleSubmit(onSubmit)}>
        <input name="firstName" {...register("firstName")} />

        <button type="submit">Save</button>
      </form>
    </div>
  );
}

export default HookFormExample;
